import "./Hero.css";
import Countdown from "../Countdown/Countdown";

class Hero extends React.Component {
  render() {
    return (
      <section className="header" id="hero">
        {/*}<Countdown />*/}
        <div id="tagline">
          <h1>Rossella & Antonio</h1>
          <h3>26 Maggio 2019</h3>
          <h3>Tenimento San Giuseppe, Foggia</h3>
        </div>
      </section>
    );
  }
}

export default Hero;
